import React, { useEffect, useState } from 'react';
import styled from 'styled-components';
import {
  Card,
  Fieldset,
  Label,
  Input,
  ErrorMessage,
  FormGrid,
  Checkbox,
  CheckboxLabel,
  Title
} from '../components/ui';
import { useParams, useHistory } from 'react-router-dom';
import axiosRequest from '../utils/axiosRequest';
import displayDate from '../utils/displayDate';
import {
  FaCcVisa,
  FaCcMastercard,
  FaCcDiscover,
  FaCcAmex
} from 'react-icons/fa';
import { useForm } from 'react-hook-form';
import { useStripe, useElements } from '@stripe/react-stripe-js';
import { useAuth0 } from '../contexts/auth0-context';
import SubmitButton from '../components/SubmitButton';

type FormData = {
  amount: string;
  authorizeOnly: boolean;
  invoiceNumbers: string;
};

const Customer: React.FC = () => {
  const [customer, setCustomer] = useState();
  const [paymentMethod, setPaymentMethod] = useState();
  const { id } = useParams();
  const { register, handleSubmit, errors } = useForm<FormData>({
    mode: 'onBlur'
  });
  const stripe = useStripe();
  const { user } = useAuth0();
  const [serverError, setServerError] = useState<String | null>(null);
  const [loading, setLoading] = useState(false);
  const history = useHistory();

  // Get Customer Info
  useEffect(() => {
    const getCustomer = async () => {
      const result = await axiosRequest(
        'get',
        process.env.API_URL + '/customer/' + id,
        null
      );
      setCustomer(result.data.customer);
      console.log(result);
    };

    try {
      getCustomer();
    } catch (err) {
      console.log(err);
    }
  }, []);

  // Get Payment Method Info
  useEffect(() => {
    const getPaymentMethod = async () => {
      const result = await axiosRequest(
        'get',
        process.env.API_URL + '/customer/' + id + '/paymentmethod',
        null
      );
      setPaymentMethod(result.data.paymentMethod);
      console.log(result);
    };

    try {
      getPaymentMethod();
    } catch (err) {
      console.log(err);
    }
  }, []);

  // Main submit function
  const onSubmit = handleSubmit(async data => {
    if (!stripe) return;

    // Reset server error message
    setServerError(null);

    console.log('Creating payment intent');
    let clientSecret;
    setLoading(true);

    try {
      // Create payment intent -- sends amount
      const paymentIntentResponse = await axiosRequest(
        'post',
        (process.env.API_URL + '/paymentintent') as string,
        {
          amount: parseFloat(data.amount) * 100,
          invoiceNumbers: data.invoiceNumbers,
          manual: data.authorizeOnly,
          user: user.name,
          email: customer?.email,
          accountNumber: customer?.metadata.accountNumber,
          customerName: customer?.name,
          paymentMethodId: paymentMethod?.id,
          customerId: customer?.id
        }
      );

      console.log('[paymentintentresponse]', paymentIntentResponse);

      if (paymentIntentResponse.error)
        throw new Error(paymentIntentResponse.error);
      clientSecret = paymentIntentResponse.data.clientSecret;

      // Use payment intent to finish transaction
      const paymentResult = await stripe.confirmCardPayment(clientSecret);

      if (paymentResult.error) {
        // Show error to your customer (e.g., insufficient funds)
        console.log(paymentResult.error);
        throw new Error(paymentResult?.error?.message || 'Error');
      } else {
        history.push('/terminal/success');
      }
    } catch (err) {
      console.log(err);
      setServerError(err.message);
      setLoading(false);
    }
  });

  const renderBrand = () => {
    if (paymentMethod.card.brand === 'visa') return <FaCcVisa />;
    if (paymentMethod.card.brand === 'mastercard') return <FaCcMastercard />;
    if (paymentMethod.card.brand === 'discover') return <FaCcDiscover />;
    if (paymentMethod.card.brand === 'amex') return <FaCcAmex />;
    return paymentMethod.card.brand;
  };

  return (
    <>
      <Title>{customer?.name}</Title>
      <Container>
        <Wrapper>
          <Card>
            <CardTitle>ACCOUNT INFORMATION</CardTitle>
            {customer && (
              <AccountInfoGrid>
                <div>Account</div> <div>{customer?.metadata.accountNumber}</div>
                <div>Email</div> <div>{customer?.email}</div>
                <div>Created</div> <div>{displayDate(customer?.created)}</div>
              </AccountInfoGrid>
            )}
          </Card>
          <Card>
            <CardTitle>CARD INFORMATION</CardTitle>
            {paymentMethod && (
              <AccountInfoGrid>
                <div>Cardholder Name</div>
                <div>{paymentMethod.billing_details.name}</div>
                <div>Card</div>
                <CardDiv>
                  <Brand>{renderBrand()}</Brand>
                  <span>{'••••' + paymentMethod?.card.last4}</span>
                  <span>
                    {paymentMethod.card.exp_month +
                      '/' +
                      paymentMethod.card.exp_year}
                  </span>
                </CardDiv>
                <div>Added</div> <div>{displayDate(paymentMethod.created)}</div>
              </AccountInfoGrid>
            )}
          </Card>
          <Card>
            <CardTitle>CHARGE CUSTOMER</CardTitle>
            <FormGrid as="form" onSubmit={onSubmit}>
              <Checkbox>
                <input
                  type="checkbox"
                  id="authorizeOnly"
                  name="authorizeOnly"
                  ref={register()}
                />
                <CheckboxLabel htmlFor="authorizeOnly">
                  Authorize Only
                </CheckboxLabel>
              </Checkbox>
              <Fieldset>
                <Label>Invoice Number(s)</Label>
                <Input
                  name="invoiceNumbers"
                  ref={register({
                    required: 'Invoice numbers required.'
                  })}
                />
                {errors.invoiceNumbers && (
                  <ErrorMessage>{errors.invoiceNumbers.message}</ErrorMessage>
                )}
              </Fieldset>
              <Fieldset>
                <Label>Amount</Label>
                <Input
                  type="number"
                  step=".01"
                  name="amount"
                  ref={register({
                    required: 'Amount required.',
                    min: 0
                  })}
                />
                {errors.amount && (
                  <ErrorMessage>{errors.amount.message}</ErrorMessage>
                )}
              </Fieldset>
              <SubmitButton
                loading={loading}
                disabled={!stripe || Object.keys(errors).length > 0 || loading}
              >
                Submit
              </SubmitButton>
              {serverError && <ErrorMessage>{serverError}</ErrorMessage>}
            </FormGrid>
          </Card>
        </Wrapper>
      </Container>
    </>
  );
};

export default Customer;

const Container = styled.div`
  display: grid;
  grid-template-columns: max-content 1fr;
`;

const Wrapper = styled.div`
  display: grid;
  grid-template-columns: 600px 600px;
  gap: 2.4rem;
  width: 100%;
`;

const AccountInfoGrid = styled.div`
  width: 100%;
  display: grid;
  grid-template-columns: 1fr 2fr;
  gap: 1rem;
  font-size: 0.9rem;
`;

const CardDiv = styled.div`
  display: grid;
  grid-template-columns: 1fr 2fr 2fr;
  gap: 0.5rem;
  max-width: 270px;
`;

const Brand = styled.div`
  svg {
    height: 24px;
    width: auto;
  }
`;
const CardTitle = styled.h2`
  font-weight: 600px;
  text-align: left;
  font-size: 1rem;
  margin-top: 0;
  border-bottom: 1px solid #d3d3d324;
  padding-bottom: 0.5rem;
`;
